import React from 'react';
import { Link } from 'react-router-dom';
import {
    AppSwitcher20,
    Help20,
    UserAvatar20,
  } from '@carbon/icons-react';
import {
  Header,
  HeaderContainer,
  HeaderName,
  HeaderNavigation,
  HeaderMenuButton,
  HeaderMenuItem,
  HeaderGlobalBar,
  HeaderGlobalAction,
  SkipToContent,
  SideNav,
  SideNavItems,
  HeaderSideNavItems,
  Dropdown,
} from 'carbon-components-react';

let dropdownItems = ["Assistant1", "Assistant2"]

const ActionsHeader = () => (
  <HeaderContainer
    render={({ isSideNavExpanded, onClickSideNavExpand }) => (
      <Header aria-label="Carbon Tutorial">
        <HeaderName element={Link} to="/" prefix="IBM">
        Actions Dashboard
        </HeaderName>
        <Dropdown
            ariaLabel="Dropdown"
            id="assistant-dropdown"
            items={dropdownItems}
            label="Assistant"/>
        <HeaderGlobalBar>
            <HeaderGlobalAction aria-label="Help">
                <Help20 />
            </HeaderGlobalAction>
            <HeaderGlobalAction aria-label="User Avatar">
                <UserAvatar20 />
            </HeaderGlobalAction>
        </HeaderGlobalBar>
      </Header>
    )}
  />
);

export default ActionsHeader;
